import { StatusBar } from 'expo-status-bar';
import React, { useState } from 'react';
import {
  StyleSheet,
  Text,
  View,
  Image,
  TextInput,
  Button,
  TouchableOpacity,
} from "react-native";
import { ScreenContainer } from 'react-native-screens';


export const SignIn = ({ navigation }) => {

  return (
    <ScreenContainer>

        <Text> SIGN IN 1</Text>
        <Button title="Login" onpress={() => navigation.push("SignIn2")}/>

    </ScreenContainer>
  );
};

export const SignIn2 = ({ navigation }) => {
  return (
    <ScreenContainer>
        <Text> SIGN IN 2</Text>

        <Button title="Login" onpress={() => navigation.push("SignIn")} />

    </ScreenContainer>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },

  image: {
    marginBottom: 30,
    width: "75%",
    height: "30%",
  },

  button: {
      paddingHorizontal: 20,
      paddingVertical: 10,
      marginVertical: 10,
      borderRadius: 5
  },


  inputView: {
    backgroundColor: "#FFC0CB",
    borderRadius: 30,
    width: "70%",
    height: 45,
    marginBottom: 20,
    alignItems: "center",
  },

  TextInput: {
    height: 50,
    flex: 1,
    alignItems: "center",
  },

  forgot_button: {
    height: 30,
    marginBottom: 30,
  },

  loginBtn: {
    width: "80%",
    borderRadius: 25,
    height: 50,
    alignItems: "center",
    justifyContent: "center",
    marginTop: 40,
    backgroundColor: "#FF1493",
  },
});
